description:
Anubis ontwikkelt een nieuwe krachtige krijger. Een zoektocht naar technologie van de Ouden (Ancients) culmineert in de schijnbare vondst van Atlantis13.Grace - 16 januari 2004 - Carter reist mee om de gestrande Prometheus terug te halen. Ze komen in een nevel terecht.

14.Fallout - 23 januari 2004 - Jonas Quinn vraagt Sg-1 om hulp als de naquada ader verandert in naquadria die de planeet onstabiel maken.

15.Chimera - 30 januari 2004 - Carter heeft een relatie met een politieagent. Ze probeert het SGC voor hem geheim te houden. Osiris (met het gastlichaam van Daniels ex) probeert bij Daniel de locatie van Atlantis los te krijgen via zijn onderbewuste.

16.Death Knell - 6 februari 2004 - Terwijl de Alpha site door Anubis wordt aangevallen, moeten Jacob en Sam vluchten met het prototype van een nieuw wapen tegen de supersoldaten.


